import React, { useEffect, useRef } from "react";

const LiquidButton = ({ svgRef }) => {
  const idRef = useRef(1);
  const xmlns = "http://www.w3.org/2000/svg";
  const tension = svgRef.current.dataset.tension * 1 || 0.4;
  const width = svgRef.current.dataset.width * 1 || 200;
  const height = svgRef.current.dataset.height * 1 || 50;
  const margin = svgRef.current.dataset.margin || 40;
  const hoverFactor = svgRef.current.dataset.hoverFactor || -0.1;
  const gap = svgRef.current.dataset.gap || 5;
  const debug = svgRef.current.dataset.debug || false;
  const forceFactor = svgRef.current.dataset.forceFactor || 0.2;
  const color1 = svgRef.current.dataset.color1 || "#36DFE7";
  const color2 = svgRef.current.dataset.color2 || "#8F17E1";
  const color3 = svgRef.current.dataset.color3 || "#BF09E6";
  const textColor = svgRef.current.dataset.textColor || "#000000";
  const text = svgRef.current.dataset.text || "Button";
  const svgDefs = useRef(null);
  const touches = useRef([]);
  const noise = svgRef.current.dataset.noise || 0;
  const svgWidth = width + margin * 2;
  const svgHeight = height + margin * 2;

  const createPoint = (x, y) => ({
    x: x,
    y: y,
    ox: x,
    oy: y,
    vx: 0,
    vy: 0,
  });

  const initOrigins = () => {
    svgRef.current.setAttribute("width", svgWidth);
    svgRef.current.setAttribute("height", svgHeight);

    const layers = [
      {
        points: [],
        viscosity: 0.5,
        mouseForce: 100,
        forceLimit: 2,
      },
      {
        points: [],
        viscosity: 0.8,
        mouseForce: 150,
        forceLimit: 3,
      },
    ];

    for (let layerIndex = 0; layerIndex < layers.length; layerIndex++) {
      const layer = layers[layerIndex];
      const points = [];

      for (let x = ~~(height / 2); x < width - ~~(height / 2); x += gap) {
        points.push(createPoint(x + margin, margin));
      }

      for (let alpha = ~~(height * 1.25); alpha >= 0; alpha -= gap) {
        const angle = (Math.PI / ~~(height * 1.25)) * alpha;
        points.push(
          createPoint(
            (Math.sin(angle) * height) / 2 + margin + width - height / 2,
            (Math.cos(angle) * height) / 2 + margin + height / 2
          )
        );
      }

      for (let x = width - ~~(height / 2) - 1; x >= ~~(height / 2); x -= gap) {
        points.push(createPoint(x + margin, margin + height));
      }

      for (let alpha = 0; alpha <= ~~(height * 1.25); alpha += gap) {
        const angle = (Math.PI / ~~(height * 1.25)) * alpha;
        points.push(
          createPoint(
            height - (Math.sin(angle) * height) / 2 + margin - height / 2,
            (Math.cos(angle) * height) / 2 + margin + height / 2
          )
        );
      }

      layer.points = points;
    }
  };

  useEffect(() => {
    initOrigins();
  }, []);

  const onMouseEnter = () => {
    TweenMax.to(idRef.current, 0.3, {
      ease: Power3.easeOut,
      startAt: { width: width, height: height },
      width: width * 1.1,
      height: height * 1.1,
    });
  };

  const onMouseLeave = () => {
    TweenMax.to(idRef.current, 0.3, {
      ease: Power3.easeOut,
      width: width,
      height: height,
    });
  };

  const onMouseMove = (e) => {
    const pos = getMousePos(svgRef.current, e);
    touches.current = [pos];
  };

  const onTouchMove = (e) => {
    e.preventDefault();
    const touches = e.changedTouches;
    const rect = svgRef.current.getBoundingClientRect();

    for (let i = 0; i < touches.length; i++) {
      const pos = {
        x: touches[i].clientX - rect.left,
        y: touches[i].clientY - rect.top,
      };
      if (pos.x > 0 && pos.x < svgWidth && pos.y > 0 && pos.y < svgHeight) {
        touches.current.push(pos);
      }
    }
  };

  const getMousePos = (svg, e) => {
    const rect = svg.getBoundingClientRect();
    return {
      x: e.clientX - rect.left,
      y: e.clientY - rect.top,
    };
  };

  const update = () => {
    if (touches.current.length > 0) {
      for (let layerIndex = 0; layerIndex < 2; layerIndex++) {
        for (
          let pointIndex = 0;
          pointIndex < layers[layerIndex].points.length;
          pointIndex++
        ) {
          const point = layers[layerIndex].points[pointIndex];
          const dx = point.ox - point.x + (Math.random() - 0.5) * noise;
          const dy = point.oy - point.y + (Math.random() - 0.5) * noise;
          const d = Math.sqrt(dx * dx + dy * dy);
          const f = d * forceFactor;
          point.vx += f * (dx / d || 0);
          point.vy += f * (dy / d || 0);

          for (
            let touchIndex = 0;
            touchIndex < touches.current.length;
            touchIndex++
          ) {
            const touch = touches.current[touchIndex];
            let mouseForce =
              layerIndex === 0
                ? layer.viscosity * layer.mouseForce
                : layer.viscosity * layer.mouseForce * hoverFactor;
            if (
              touch.x > 0 &&
              touch.x < svgWidth &&
              touch.y > 0 &&
              touch.y < svgHeight
            ) {
              const mx = point.x - touch.x;
              const my = point.y - touch.y;
              const md = Math.sqrt(mx * mx + my * my);
              const mf = Math.max(
                -layer.forceLimit,
                Math.min(layer.forceLimit, (mouseForce * layer.forceLimit) / md)
              );
              point.vx += mf * (mx / md || 0);
              point.vy += mf * (my / md || 0);
            }
          }

          point.vx *= layer.viscosity;
          point.vy *= layer.viscosity;
          point.x += point.vx;
          point.y += point.vy;
          point.vx *= 1 - point.viscosity;
          point.vy *= 1 - point.viscosity;
        }
      }
    }
  };

  const animate = () => {
    update();
    requestAnimationFrame(animate);
  };

  useEffect(() => {
    animate();
  }, []);

  return (
    <div
      className="liquid-button"
      onMouseEnter={onMouseEnter}
      onMouseLeave={onMouseLeave}
      onMouseMove={onMouseMove}
      onTouchMove={onTouchMove}
    >
      <svg
        ref={svgRef}
        xmlns={xmlns}
        version="1.1"
        id={`liquid-button-${idRef.current}`}
        viewBox={`0 0 ${svgWidth} ${svgHeight}`}
      >
        <defs ref={svgDefs}>
          <linearGradient
            id={`liquid-button-gradient-${idRef.current}`}
            x1="0%"
            y1="0%"
            x2="100%"
            y2="0%"
          >
            <stop offset="0%" style={{ stopColor: color1 }} />
            <stop offset="50%" style={{ stopColor: color2 }} />
            <stop offset="100%" style={{ stopColor: color3 }} />
          </linearGradient>
        </defs>
        <path
          d={`
            M ${margin} ${margin}
            L ${margin + width} ${margin}
            C ${margin + width + width / 6} ${margin} ${
            margin + width + width / 6
          } ${margin + height} ${margin + width} ${margin + height}
            L ${margin} ${margin + height}
            C ${margin - width / 6} ${margin + height} ${
            margin - width / 6
          } ${margin} ${margin} ${margin}
          `}
          fill={`url(#liquid-button-gradient-${idRef.current})`}
        />
        <text
          fill={textColor}
          x={svgWidth / 2}
          y={svgHeight / 2}
          alignmentBaseline="middle"
          textAnchor="middle"
          fontSize="20"
          fontWeight="bold"
        >
          {text}
        </text>
      </svg>
    </div>
  );
};

export default LiquidButton;
